import React, { useRef, useState, Suspense } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'
import { softShadows, MeshWobbleMaterial, OrbitControls, useGLTF, PerspectiveCamera  } from '@react-three/drei'
//import Header from "./components/header"
import { proxy, useProxy } from 'valtio'
import './App.css'

const state = proxy({sand:"#000000",})

softShadows();

function Sand(props) {
  const group = useRef()

  const { nodes, materials } = useGLTF('Sand.glb')
  return (
    <group ref={group} {...props} dispose={null}>
      <PerspectiveCamera makeDefault={false} far={10000000000} near={0.01} fov={31.42} position={[8220, 400, 1386.32]} />
      <PerspectiveCamera
        makeDefault={false}
        far={10000000000}
        near={0.01}
        fov={31.42}
        position={[0, 560, 4060]}
        rotation={[0, 0, 0]}
      />
      <mesh
        geometry={nodes.Landscape3.geometry}
        material={nodes.Landscape3.material}
        material-color={"#000000"}
        position={[91.35, 0, -12555.25]}
        rotation={[-Math.PI, 0, -Math.PI]}
      />
      <mesh
        geometry={nodes.Landscape2.geometry}
        material={nodes.Landscape2.material}
        position={[-3919.12, 0, -8008.77]}
        rotation={[0, -1.57, 0]}
      />
      <mesh
        geometry={nodes.Landscape1.geometry}
        material={nodes.Landscape1.material}
        position={[3549.64, 0, -7983.36]}
      />
      <mesh geometry={nodes.Landscape.geometry} material={nodes.Landscape.material} />
    </group>
  )
}

function App() {
  return (

    <Canvas>
      <ambientLight intensity={0.5} />
      <Suspense fallback={null}>
        <Sand />
      </Suspense>
    </Canvas>
  )
}

export default App
